import { useState } from "react";
import BlogList from "./BlogList";

const Home = () => {
  const [blogs, setBlogs] = useState([
    { title: "My new website", body: "lorem ipsum...", author: "Mario", id: 1 },

    {
      title: "My new website",
      body: "lorem ipsum...",
      author: "Gabriel",
      id: 2,
    },

    {
      title: "My new website",
      body: "lorem ipsum...",
      author: "George",
      id: 3,
    },
  ]);
  return (
    <div className="home">
      <BlogList blogs={blogs} />
    </div>
  );
};

export default Home;
